  plugins: [
    cloudflare({
      viteEnvironment: { name: "worker" },
      // Try to use external wrangler binary on NixOS
      miniflare: {
        binPath: process.env.WRANGLER_BINARY,
      }
    }),
    redwood(),
  ],
  build: {
    rollupOptions: {
      external: ['/duckdb/duckdb-browser.mjs']
    }
  }
});

